(2, 'ganancias del sistema de gestión de calidad', 'Algunos piensan que la gestión de calidad consiste en un gasto interminable, que las empresas deben realizar para garantizar que sus productos o servicios no sean defectuosos y cumplan con los requisitos básicos. Una adecuada implementación de un sistema de gestión de calidad, sin embargo, va más allá, pues ofrece un valor real y muchos beneficios para la organización.\n \nLos estándares de calidad pueden ser usados para que las organizaciones sean más productivas, cumplan con las expectativas de sus clientes, sean responsables con el ambiente y garanticen la sostenibilidad. Sin embargo, el sólo estándar no es suficiente para alcanzar lo anteriormente mencionado; también es necesario desarrollar paralelamente un sistema de gestión que integre compromiso, desde la alta dirección hacia todos niveles de la organización, que pueda presentar resultados traducidos en utilidades y como consecuencia, un ambiente de trabajo agradable para todos sus miembros. Todas las personas deseamos un ambiente laboral adecuado, mejores prácticas, un desarrollo sostenible; deberíamos entonces, dejar de lado el pensamiento de que la certificación es un sello más por el que se paga o por el que se cobra y comenzar a vivir plenamente su funcionalidad.\n \nAlgunas críticas hacia los estándares de calidad y del modelo que conllevan, se refieren muchas veces al exceso de burocracia y la posibilidad de un cumplimiento que no va más allá de lo formal; lo que da pie a pensar, que no hay una comprensión de los principios de la calidad, evidenciado en una falta de cultura frente a esta y de la proliferación de una visión cortoplacista, esto es causal de una incorrecta implementación.\n \nSobre los beneficios de la norma ISO 9001, un estudio de la Universidad de Harvard señaló los poderosos resultados obtenidos por las organizaciones que adoptaron este estándar de calidad, en comparación con aquellas que no lo hicieron. Los adoptantes de dichas medidas consiguieron materializar los siguiente beneficios:\n \n- Experimentar un crecimiento de ventas del 10%.\n- Presentar una mayor cantidad de informes con cero reclamaciones de parte de los trabajadores.\n- Tener un crecimiento del empleo de un 10% más rápido que las otras empresas.\n- Aumentar la nómina de pago en un 13.5 %.\n- Contar con más probabilidades de sobrevivir a comparación de los no adoptantes.\n \nAdemás, un estudio de la British Standards Institution reveló que los clientes con certificación ISO 9001 obtuvieron estos otros beneficios:\n \n- Superar al mercado en más del 100 %.\n- El 55 % logró ahorrar costos.\n- El 71 % adquirió nuevos clientes y retuvo a los ya existentes.\n- El 75 % aumentó su desempeño operacional.\n- El 75 % mejoró los niveles de satisfacción y lealtad de sus clientes.\n- Los ciclos de fabricación se redujeron en un 48 %.\n \nA través de un proceso de mejora continua, al observar los procesos y perfeccionarlos, el SGC hace especial hincapié en la toma de decisiones basada en hechos. Esta toma de decisiones inteligente representa una parte estándar de los negocios y demuestra la credibilidad de la empresa a los interesados y socios comerciales.\n \nSi su empresa no ha implementado el sistema de gestión de calidad, comuníquese con nosotros y le indicaremos paso a paso cómo instaurarla.\n', 'Calidad', '2022-04-30 20:32:34', '2022-05-06 00:51:27', 6, NULL, 0),
(4, 'LA GESTIÓN DOCUMENTAL MÁS QUE ORDEN', '¿Qué pasaría si los documentos de tu empresa se llegan a perder? Muy probablemente varios de tus procesos administrativos, legales y financieros pueden verse seriamente afectados. Por ello antes de que ocurra un incidente de esta magnitud, es importante ejecutar estrategias de gestión documental, las cuales pueden garantizar el correcto manejo de toda tu información. \n \nLa gestión documental es el conjunto de procesos que se enfocan en optimizar el almacenamiento, revisión, recuperación y tratamiento de los documentos que se manejan al interior de las empresas. En sí, su propósito es el de controlar de manera adecuada, eficiente y protegida la información de relevancia de cada proceso administrativo, jurídico, financiero o legal. Su implementación es sin duda, una de las mejores estrategias para garantizar no solo la seguridad de la información, sino que también para llevar a las empresas por el camino de la eficiencia, el desarrollo y el cumplimiento normativo.\n \nCuando una empresa hace uso de la gestión documental, se nota, más que todo al momento en el que sus empleados o colaboradores tienen acceso a la información necesaria, en tiempo real y sin muchos conflictos. ¿La razón?, la gestión documental permite la clasificación, tipificación y archivo de los documentos según su uso y relevancia.\n \nEs decir, cuando un área necesita de algún documento en específico para culminar una función, podrá acceder a este sin contratiempos ya que, gracias a este sistema, podrán saber dónde y de qué manera acceder a él en un tiempo reducido y de manera eficiente.\n \n<strong> Esta implementación contribuye con aspectos como: </strong>\n \n<strong>-</strong> Transformar los documentos en papel a formato electrónico: Esto evitaría entre otras cosas la pérdida de dichos documentos en casos como incendios, inundaciones, robos, etc.\n<strong>-</strong> Centralizar todos los documentos de la empresa.\n<strong>-</strong> Catalogar la documentación con categorías, subcategorías y metadatos da como resultado que sea más fácil de organizar, buscar y recuperar. Un buscador por palabras clave puede facilitar resultados en pocos segundos.\n<strong>-</strong> Establecer usuarios con perfiles de seguridad, donde los usuarios puedan acceder a la documentación que tengan acceso, evitando que se acceda a documentación sin permiso.\n \nFinalmente, cuando se implementan procesos de gestión documental, cuando una empresa ahorra en el uso del papel, administra el almacenamiento y promueve la digitalización de la información; está contribuyendo en el correcto uso de los recursos. Esto lleva a minimizar el impacto ambiental y a maximizar el desarrollo económico. Por eso, ten una correcta gestión documental y organízate, tu empresa te lo agradecerá.', 'Salud', '2022-04-30 20:32:34', '2022-04-30 20:32:34', 6, NULL, 0),
