(1, 'REQUISITOS MÍNIMOS PARA EL DESARROLLO DE TRABAJO EN ALTURAS', 'RESOLUCIÓN 4272 DE 2021 - REQUISITOS MÍNIMOS PARA EL DESARROLLO DE TRABAJO EN ALTURAS.\r\n\r\nEsta resolución se expide con el fin de establecer los requisitos mínimos de seguridad para el desarrollo de trabajos en alturas (TA) y lo concerniente con la capacitación y formación de los trabajadores y aprendices en los centros de entrenamiento de Trabajo en Alturas (AT), aplica a todos los empleadores contratantes, contratistas, aprendices y trabajadores de todas las actividades económicas que desarrollen trabajo en alturas.', 'Normas', '2022-05-06 01:46:54', '2022-05-13 03:55:06');

