INSERT INTO `productos` (`id`, `name`, `descripcion`, `precio`, `cantidad`, `categoria`, `valoracion`, `created_at`, `updated_at`) VALUES
(1, 'protectores auditivos steelpro modelo cm- 501', 'La línea de protectores auditivos Steelpro modelo CM- 501 para casco diseñada para proteger contra los riesgos diarios producidos por el ruido evitando pérdidas de audición. Es un protector auditivo dieléctrico ya que no posee componentes metálicos.', 0.00, 0, 'PROTECCION AUDITIVA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(2, 'protector auditivo de insercion', 'Fabricado en silicona, con cuatro membranas de mayor a menor dimensión y una excelente acomodación dentro del oído, que incrementa los niveles de atenuación. Con cámara interna de aire. Material hipo alergénico de fácil mantenimiento y duración. Incluye cordel e insertador (ES LA PARTE BLANDA EN LA CUAL SE INTRODUCE EL CORDEL) y estuche tipo llavero. Color de alta visibilidad para fácil supervisión. Empaque individual.\n        Nivel reducción ruido Mínimo 27 DB', 0.00, 0, 'PROTECCION AUDITIVA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(3, 'protector auditivo desechable', 'Protectores Auditivos Desechables en Espuma de Poliuretano. Estos cómodos tapones auditivos tienen una forma cónica que permite un buen ajuste al canal auditivo y están hechos de material hipoalergénico', 0.00, 0, 'PROTECCION AUDITIVA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(4, 'guante carnaza lona sencillo', 'Fabricado en carnaza\n        Dorso en sintético\n        Talla única\n        Puño en sintético', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(5, 'guante vaqueta sencillo', 'Fabricado en vaqueta\n        Talla única\n        Puño en sintético \n        Aplicación metalmecánica', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(6, 'guante hilaza latex', 'Fabricado en poli algodón\n        Recubierto en latex 3/4\n        Color azul\n        Aplicación en construcción', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(7, 'guante industrial orillo c-35', 'Fabricado en Latex\n        Calibre 35\n        Antideslizante\n        Bicolor', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(8, 'guante nitrilo 18\"', 'Nitrilo 100%\n        Largo 18\" (45.72cm)\n        Calibre 22 mils\n        Flocado interior y texturizado en la palma', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(9, 'guante hilaza pvc dos caras', 'Guante de hilaza con pepitas de PBC en las dos caras', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(10, 'guante desechable para manipulacion de alimentos', 'Guantes plásticos en polietileno de baja densidad no contaminantes. Desechables\n        Características del diseño: Ambidiestro', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(11, 'manga para proteccion solar 20', 'Licra especial P/Filtración de Rayos UV.\n         Fibra transpirable y secado rápido\n         Largo de manga: mínimo 40cm', 0.00, 0, 'PROTECCION MANOS', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(12, 'casco de seguridad con barbuquejo 3 puntos de apoyo', 'Casco dieléctrico clase E cuyo propósito es reducir el riesgo ante la exposición a conductores eléctricos de Alto Voltaje, probados a 20.000 voltios. Fabricado\n        en Polipropileno, Polietileno y/o ABS.', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(13, 'casco de seguridad dielectrico tipo i amarillo', 'Casco dieléctrico: ofrece protección contra alto voltaje (hasta 30.000 Voltios).\n        6 puntos de apoyo suspensión, sistema de ajuste Ratchet.\n        Sistema de inserción para tapa oídos.\n        Visera para adaptar hacia adelante o hacia atrás', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(14, 'casco armadura dielectrico con rachet blanco', 'Polipropileno de alta densidad.\n        4 puntos de apoyo para tafilete en los cuales será distribuida la fuerza de impacto.\n        Orificios o cavidades laterales para ensamble de protector auditivo de copa.\n        Resistencia a 20000 V (Voltios), lo que lo hace dieléctrico.\n        3 Orificios para conexión de barbuquejo de hasta 3 puntos', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(15, 'casco steelpro mountain tipo ii blanco', 'Diseñado para trabajo en altura, espacios confinados y trabajos en lugares con altos voltajes.\n        Fabricados en material termoplástico ABS de alta resistencia.\n        Posee suspensión tipo Ratchet.\n        Barbuquejo de cuatro puntos con soporte de barbilla de caucho sintético siliconizado.\n        Posee reflectivo termoplástico ubicado en la zona posterior del equipo sobre la nuca.\n        Perforaciones laterales para complementar con accesorios de tamaño universal.\n        Espuma interior de poliestireno expandido (EPS).\n        Visera corta para trabajos en altura, espacios confinados y alto voltaje.\n        Certificación ANSI Z89.1.2009, Nch 461.2009.\n        Casco dieléctrico.\n        Peso: 465 gr.\n        Tamaño de ajuste (55-65cm) de acuerdo al ratchet.', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(16, 'capuchon', 'Gorros de protección fabricados en tela o dril, Posee protección adicional en la parte trasera del cuello contra los rayos solares, colores surtidos.', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(17, 'gorro tipo chavo', 'Gorros de protección fabricados en tela o dril, Posee protección adicional en la parte trasera del cuello contra los rayos solares, colores surtidos.', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(18, 'gorro zubiola plegable paquete x 10 unidades', 'Tela polipropileno, con banda elástica para la cabeza.\n        Ideal para la industria farmacéutica, procesamiento de comidas, o la industria en general.', 0.00, 0, 'PROTECCIÓN CABEZA', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(19, 'gafa de seguridad con proteccion lateral', 'Lente de policarbonato, marco de nylon con patillas regulables\n        Filtro 99,9% de protección UV. C\n        Protección lateral para una mayor cobertura del rostro', 0.00, 0, 'PROTECCIÓN VISUAL', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32'),
(20, 'gafa de seguridad sport kamel', 'Montura universal y liviana\n        Lente en policarbonato, peso 30 gramos\n        Filtra 99.9% de los rayos ultravioletas\n        Anti-empañante, aprobación ANSI-Z87+', 0.00, 0, 'PROTECCIÓN VISUAL', 0.00, '2022-04-09 11:38:32', '2022-04-09 11:38:32');

