INSERT INTO `servicios` (`id`, `name`, `descripcion`, `contenido`, `img`, `created_at`, `updated_at`) VALUES
(1, 'Gestión de calidad (Normas ISO 9001, ISO 14001, ISO 45001)', 'Los Sistemas de Gestión son una herramienta que le permite a las empresas optimizar recursos, reducir costos y mejorar la productividad.', 'Están basados en Normas Internacionales que permiten controlar distintas facetas en una empresa, como la calidad de su producto o servicio, los impactos Ambientales que pueda ocasionar, la seguridad y salud de los trabajadores, la responsabilidad social o la innovación.', 'img/web/gestioncalidad2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(2, 'Gestión de salud y seguridad en el trabajo', 'Diseñamos e implementamos el SG SST, para dar cumplimiento con el Decreto 1072 de 2015 y la resolución 0312 de 2019.', 'De acuerdo al decreto 1072 de 2015 el empleador debe definir los requisitos de conocimiento y práctica en Seguridad y Salud en el Trabajo, necesarios para sus trabajadores, también debe adoptar y mantener disposiciones para su cumplimiento en todos los aspectos de la ejecución, con el fin de prevenir accidentes de trabajo y enfermedades laborales.', 'img/web/gestionsgsst2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(3, 'Gestión documental', 'La gestión documental consiste en controlar de un modo eficiente y sistemático la creación, la recepción, el mantenimiento, la utilización y la disposición de los documentos (ISO 15489-1: 2001).', 'El archivo ofrece apoyo interno en la toma de decisiones para el trabajo diario y asegura una preservación adecuada del patrimonio histórico y documental de la organización. Asimismo, tiene un importante papel en la calidad y la imagen de la organización, por los siguientes motivos:', 'img/web/gestiondocumental2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(4, 'Gestión ambiental', 'PREV&CONS realiza para sus clientes asesorías ambientales en: Manejo de residuos sólidos, entre otros.', 'En PREV&CONS trabajamos para el continuo mejoramiento e implementación de los requisitos legales adaptados a su empresa, minimizando los impactos y fortaleciendo su economía en pro de una ventaja competitiva.', 'img/web/gestionambiental2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(5, 'Plan Estrategico de Seguridad Vial', 'Toda entidad u organización, pública o privada, que cuente con una flota de vehículos automotores o que contrate personal de conductores, deberá contar con un Plan Estratégico de Seguridad Vial.', 'El Plan Estratégico de Seguridad Vial  -PESV-, es una herramienta de gestión que contiene las acciones, mecanismos, estrategias y medidas de planificación, implementación, seguimiento y mejora que deben aportar las diferentes entidades, organizaciones o empresas del sector público o privado de conformidad con el Art. 110 del Decreto Ley 2106 de 2019, encaminadas a generar hábitos, comportamientos y conductas seguras en las vías para prevenir riesgos, reducir la accidentalidad vial y disminuir sus efectos nocivos. Art. 1° del Decreto 1252 de 2021.', 'img/web/pesv2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(6, 'Auditorías de gestión', 'Evaluamos el desempeño de procesos de negocios para validar que tanto están aportando al cumplimiento de los objetivos corporativos de la organización.', 'PREV&CONS presta servicios de evaluación de la conformidad a los diferentes sistemas de Gestión con el propósito de identificar oportunidades de mejora en las organizaciones y generar un valor agregado en los colaboradores con un sentido imparcial, humano y objetivo.', 'img/web/auditorias2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(7, 'Capacitaciones para SG SST', 'Todo sistema de gestión requiere la sensibilización del personal para lograr alineación del hacer diario con los objetivos y políticas planteados por la dirección en la planeación.', 'De acuerdo al decreto 1072 de 2015 el empleador debe definir los requisitos de conocimiento y práctica en Seguridad y Salud en el Trabajo, necesarios para sus trabajadores, también debe adoptar y mantener disposiciones para su cumplimiento en todos los aspectos de la ejecución, con el fin de prevenir accidentes de trabajo y enfermedades laborales.', 'img/web/capacitaciones2', '2022-04-09 00:38:32', '2022-04-09 00:38:32'),
(8, 'Reporte e investigación de incidentes, accidentes de trabajo y enfermedades laborales', 'Todos los accidentes e incidentes laborales deben ser investigados (estudiados) de manera seria, técnica y científica para establecer cuáles fueron sus causas.', 'La investigación del accidente Laboral (trabajo) es una acción importante de la Seguridad Industrial, y lo enfoca desde el punto de vista preventivo, estudiando sus causas (por qué ocurren), sus fuentes (actividades comprometidas en el accidente), sus agentes (medios de trabajo participantes), su tipo (cómo se producen o se desarrollan los hechos), todo ello con el fin de desarrollar la prevención.', 'img/web/reporteincidentes2', '2022-04-09 00:38:32', '2022-04-09 00:38:32');

